{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ivandaudt/jm-biogas-production-experiment-analysis-jumpstart?scriptVersionId=117225067\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"\n## The goal of the experiment\nThe goal of this experiment executed by prof Jackson Milano/[Universidade Positivo](http://www.up.edu.br), from Curitiba/BR, is to identify the optimal setup for continuous biogas production across the year in the subtropical climate in the south region of Brazil.\n\n## Data load and preparation for analysis\n\nThese are the preparation steps with R language, for those interested on further analysing his biogas experiment.\n\nFiles he provided will be loaded, cleaned and organized according to the phases he described, so anyone can further analyse it from that point on.\n\nHis biodigestor setup, including pictures and modifications across phases are described in his draft article (in Portuguese, with an abstract in English). It's available as a pdf attached to the dataset. I recommend taking a look at it to understand changes across phases.\n\n### Phases in summary\n1. **Test 0**: biodigestor 1 installation straight to the ground [may-out/21]\n2. **Test 1**: biodigestor 1 + 2 with insulation [nov/21-feb/22]\n3. **Test 2**: biodigestor 1 + 2 with 20 sec aggitation [mar-may/22]\n4. **Test 3**: biodigestor 1 + 3 with 40 sec aggitation [may-jul/22]\n\n### Experiment Highlights\n- these are considered *domestic* biodigestors, sold by [BGS](http://bgsequipamentos.com.br)\n- biodigestor 1 setup is maintained across the entire experiment\n- biodigestor 2 received increments to increase production\n- the *fuel* for biogas production was 32kg of cow manure per day (16kg each)\n- average ground and environment temperature has high influence on biogas production\n- winter is long with low temperatures for days or weeks in the region\n\n## The output\nThe final product of the following code will be a **biogasdf** data frame, which can be used for further studies and analysis (which I might also do some other day).\n\nYou can copy this notebook and take it as starting point for your own analysis with R.\n\nHave fun!","metadata":{}},{"cell_type":"code","source":"#setup\nlibrary(tidyverse) # metapackage of all tidyverse packages\nlibrary(ggplot2) #for initial charts\nsetwd(\"/kaggle/input/biogas-production-bgs-domestic-biodigestor\")\n\n#get files to import in vector\nthefiles <- list.files(pattern = \"biogas-bio1-\")\n#specify columns types to load and skip others\ncols2read <- cols_only(\n  Data = col_date(),\n  Hora = col_time(),\n  tempSubst = col_double(), #fluid temperature\n  tempSolo = col_double(), #soil/ground temperature\n  umidAmb = col_double(), #air humidity\n  tempAmb = col_double(), #air temperature\n  umidGas = col_double(),\n  tempGas = col_double(),\n  decDeBiogas = col_double()\n)\n#load all data from the files for bio 1, phase 0, bind data and get rid of \"X\" cols\n#only 10 cols are expected. Others will be ignored\nbio1 <- lapply(thefiles, read_csv, col_types = cols2read) %>% bind_rows(.) \n\n#get bio 2 files to import in vector\nthefiles <- list.files(pattern = \"biogas-bio2-\")\n#load files where data for bio 2 is isolated\nb2 <- lapply(thefiles, read_csv, col_types = cols2read) %>% bind_rows(.) \n\n#build new list for bio 1 + bio 2\nthefiles <- list.files(pattern = \"biogas-bio1_\")\n#specify columns to read and type\ncols2read <- cols_only(\n  Data = col_date(),\n  Hora = col_time(),\n  tempGasB2 = col_double(),\n  tempAmb = col_double(), #air temperature\n  tempGas = col_double(),\n  umidGasB2 = col_double(),\n  TempSoloB2 = col_double(), #soil/ground temperature\n  umidGas = col_double(),\n  tempSubst = col_double(), #fluid temperature\n  umidAmb = col_double(), #air humidity\n  decDeBiogasB2 = col_double(),\n  decDeBiogas = col_double(),\n  tempSubstB2 = col_double(), #fluid temperature\n  tempSolo = col_double() #soil/ground temperature\n)\n#load files for subsequent phases (bio1 + bio2)\ntmpdf <- lapply(thefiles, read_csv, col_types = cols2read) %>% bind_rows(.) \n#select columns for biodigestor 2\ncolsbio2 <- c(\"Data\", \"Hora\", \"tempAmb\", \"umidAmb\", str_subset(names(tmpdf), \"B2$\"))\nbio2 <- select(tmpdf, all_of(colsbio2))\n#identify biodigestor\nbio2$bio_id <- \"2\"\n#rename and get rid of suffix B2\nnames(bio2) <- str_replace_all(names(bio2), \"B2\", \"\")\n#remove columns for bio2 from tmpdf to import into bio1 dataset\ntmpdf <- select(tmpdf, -ends_with(\"B2\"))\nbio1 <- bind_rows(bio1, tmpdf)\n#add columns to identify biodigestor\nbio1$bio_id <- \"1\"\n#fix caps before merge\nnames(bio1) <- tolower(names(bio1))\nnames(bio2) <- tolower(names(bio2))\n#combine all data\nbiogasdf <- bind_rows(bio1, bio2)\n#housekeeping\nrm(tmpdf)\nrm(colsbio2)\nrm(bio1)\nrm(b2)\nrm(bio2)\nrm(cols2read)","metadata":{"execution":{"iopub.status.busy":"2023-01-24T20:56:41.386749Z","iopub.execute_input":"2023-01-24T20:56:41.388554Z","iopub.status.idle":"2023-01-24T20:56:46.479701Z"},"trusted":true},"execution_count":9,"outputs":[{"name":"stderr","text":"\u001b[1m\u001b[22mNew names:\n\u001b[36m•\u001b[39m `` -> `...11`\n\u001b[36m•\u001b[39m `` -> `...12`\n\u001b[36m•\u001b[39m `` -> `...13`\n\u001b[36m•\u001b[39m `` -> `...14`\n\u001b[36m•\u001b[39m `` -> `...15`\n\u001b[36m•\u001b[39m `` -> `...16`\n\u001b[36m•\u001b[39m `` -> `...17`\n\u001b[36m•\u001b[39m `` -> `...18`\n\u001b[36m•\u001b[39m `` -> `...19`\n\u001b[36m•\u001b[39m `` -> `...20`\n\u001b[36m•\u001b[39m `` -> `...21`\n\u001b[36m•\u001b[39m `` -> `...22`\n\