 are errors and will become NA\nbiogasdf <- mutate(biogasdf, \n                 tempamb = ifelse(tempamb >= 998, NA ,tempamb),\n                 umidgas = ifelse(umidgas >= 998, NA, umidgas),\n                 tempgas = ifelse(tempgas >= 998, NA, tempgas)\n                 )\n#add phases\nbiogasdf <- mutate(biogasdf, \n                   phase_test = case_when(\n                     data < as.Date(\"2021-11-01\") ~ \"0\",\n                     data < as.Date(\"2022-03-01\") ~ \"1\",\n                     data < as.Date(\"2022-05-07\") ~ \"2\",\n                     data >= as.Date(\"2022-05-07\") ~ \"3\"\n                    )\n                   )\n#phases as factors\nbiogasdf$phase_test <- as.factor(biogasdf$phase_test)\n\n#remove NAs from production data\nbiogasdf$decdebiogas[is.na(biogasdf$decdebiogas)] <- 0\n\n#translate names to english\nnames(biogasdf) <- c(\"date\",\"hour\",\"fluid_temp\",\n                     \"ground_temp\", \"air_umidity\",\n                     \"air_temp\", \"gas_umidity\",\n                     \"gas_temp\", \"dm3_gas\",\n                     \"bio_id\",\"phase_test\")","metadata":{"execution":{"iopub.status.busy":"2023-01-24T20:56:46.482041Z","iopub.execute_input":"2023-01-24T20:56:46.483397Z","iopub.status.idle":"2023-01-24T20:56:46.549476Z"},"trusted":true},"execution_count":10,"outputs":[]},{"cell_type":"markdown","source":"## Taking a look at the data\n\nFrom this point on, we can look at the data set and initiate analysis\n\n### A quick summary\nA quick overview of the various columns of this dataset, where you can see a lot of NAs, which must be treated accordingly.\n","metadata":{}},{"cell_type":"code","source":"#get basic stats\nsummary(biogasdf)","metadata":{"execution":{"iopub.status.busy":"2023-01-24T20:56:46.551843Z","iopub.execute_input":"2023-01-24T20:56:46.553177Z","iopub.status.idle":"2023-01-24T20:56:46.588941Z"},"trusted":true},"execution_count":11,"outputs":[{"output_type":"display_data","data":{"text/plain":"     